import React, { Component } from "react";
import { withRouter } from 'react-router-dom';
import { connect } from 'unistore/react';
import { actions } from '../store';
import { Link } from 'react-router-dom';

import Search from "../Component/Search";
import Product from "../Component/Product";

import "../css/shop.css"


class Shop extends Component {
    render() {
        return (
            <div className="App">
                <div class="jumbotron jumbo-store">
                    <p><img src={require("../images/logo/retrovert-white.png")} width="50%" alt="" /></p>
                    <h2>You can buy any retro stuff here with the best price</h2>
                </div>


                <Search />
                <h1 class="mt-5 pt-5" style={{ fontWeight: 700 }}>We Sell Stuff For Your Retro Desire</h1>
                <Product />
            </div>
        );
    }
}
export default withRouter(Shop)
